import {useState} from "react";
import "./App.css";

// import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
// import {faPencilAlt, faTrash} from "@fortawesome/free-solid-svg-icons";

function App() {
  const [patienter, setPatienter] = useState([
    {id: 12345, plats: "101", datum: "2023-09-30", fvk: "LEB"},
    {id: 67890, plats: "111", datum: "2023-10-10", fvk: "MD"},
  ]);
  //  state för ny patient - start in = input
  const [inPlats, setInPlats] = useState("");
  const [inDatum, setInDatum] = useState("");
  const [inKontakt, setInKontakt] = useState("");

  //  state för redigering
  const [redigeradPatient, setRedigeradPatient] = useState({
    plats: "",
    datum: "",
    fvk: "",
  });

  //funktioner som ska vara i appen
  const uniqueId = () => {
    return new Date().getTime(); // Ersätt med din egen unika ID-genereringslogik
  };

  const handleSubmitNypatient = (e) => {
    e.preventDefault();
    const nyPatient = {
      id: uniqueId(),
      plats: inPlats,
      datum: inDatum,
      fvk: inKontakt,
    };
    setPatienter((prevPatienter) => [...prevPatienter, nyPatient]);
    setInPlats("");
    setInDatum("");
    setInKontakt("");
  };

  const startRedigering = (patient) => {
    setRedigeradPatient(patient);
  };

  const sparaRedigering = () => {
    console.log(redigeradPatient); // Lägg till detta för att inspektera värdet
    if (redigeradPatient) {
      setPatienter((prevPatienter) => {
        return prevPatienter.map((p) => {
          if (p.id === redigeradPatient.id) {
            return redigeradPatient;
          } else {
            return p;
          }
        });
      });
      setRedigeradPatient({
        plats: "",
        datum: "",
        fvk: "",
      });
    }
  };

  const deletePatient = (id) => {
    setPatienter((prevPatienter) => {
      return prevPatienter.filter((p) => p.id !== id);
    });
  };
  function changeData(e, fieldName) {
    const editedPatient = {
      id: redigeradPatient.id,
      datum: redigeradPatient.datum,
      plats: fieldName === "plats" ? e.target.value : redigeradPatient.plats,
      fvk:
        fieldName === "fvk"
          ? e.target.value === ""
            ? redigeradPatient.fvk
            : e.target.value
          : redigeradPatient.fvk,
    };
    setRedigeradPatient(editedPatient);
  }
  return (
    <div className="App">
      <h1>Teest</h1>
      <br />
      {/* //redigera formulär */}
      {redigeradPatient && (
        <div className="card">
          <h2>Redigera Patient</h2>
          <form>
            <div className="form-container">
              <div className="va-container">
                <input
                  type="text"
                  value={redigeradPatient.plats}
                  onChange={(e) => changeData(e, "plats")}
                />
                <input
                  type="text"
                  value={redigeradPatient.fvk}
                  onChange={(e) => changeData(e, "fvk")}
                />
                <input />
              </div>
              <div className="ho-container">
                <input type="date" value={redigeradPatient.datum} readOnly />
                <input />
                <input />
              </div>
            </div>
            <div className="btn-container">
              <button onClick={sparaRedigering}>Spara redigering</button>
            </div>
          </form>
        </div>
      )}

      <br />
      {/* ny patient form - start */}
      <div className="card">
        <form onSubmit={handleSubmitNypatient}>
          <div className="form-container">
            <div className="va-container">
              <input
                type="text"
                value={inPlats}
                onChange={(e) => setInPlats(e.target.value)}
              />
              <input
                type="text"
                value={inKontakt}
                onChange={(e) => setInKontakt(e.target.value)}
              />
              <input />
            </div>
            <div className="ho-container">
              <input
                type="date"
                value={inDatum}
                onChange={(e) => setInDatum(e.target.value)}
              />
              <input />
              <input />
            </div>
          </div>
          <div className="btn-container">
            <button type="submit">Spara</button>
          </div>
        </form>
      </div>

      {/* tabell av patienter */}
      <table className="table">
        <thead>
          <tr>
            <th>Plats</th>
            <th>Datum</th>
            <th>FVK</th>
            <th></th>
          </tr>
        </thead>
        <tbody>
          {patienter.map((p) => (
            <tr key={p.id}>
              <td>
                {p.plats}
                {/* <span style={{color: "green", margin: "10px"}}>
                    <FontAwesomeIcon
                      icon={faPencilAlt}
                      size="xs"
                      data-tip="Redigera plats"
                      onClick={() => startRedigering(p)}
                    />
                  </span> */}
              </td>
              <td>{p.datum}</td>
              <td>{p.fvk}</td>
              <td>
                <button onClick={() => startRedigering(p)}>Redigera</button>
                <button onClick={() => deletePatient(p.id)}>Ta bort</button>
              </td>

              {/* <td>
                  <span style={{color: "red", margin: "3px"}}>
                    <FontAwesomeIcon
                      icon={faTrash}
                      size="lg"
                      onClick={() => deletePatient(p.id)}
                    />
                  </span>
                </td> */}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
